    "ex_align_help": {                                "en": "You need to select a reference element for aligning. Afterwards, choose each element, which should be aligned the same.", "de": "Sie müssen ein Referenzelement zum Ausrichten auswählen. Wählen Sie anschließend jedes Element aus, das gleich ausgerichtet sein soll.", "ru": "Вам необходимо выбрать опорный элемент для выравнивания. После этого выберите каждый элемент, который должен быть выровнен одинаково.", "pt": "Você precisa selecionar um elemento de referência para alinhamento. Em seguida, escolha cada elemento, que deverá ficar alinhado da mesma forma.", "nl": "U moet een referentie-element selecteren om uit te lijnen. Kies daarna elk element, dat op dezelfde manier moet worden uitgelijnd.", "fr": "Vous devez sélectionner un élément de référence pour l'alignement. Ensuite, choisissez chaque élément qui doit être aligné de la même manière.", "it": "È necessario selezionare un elemento di riferimento per l'allineamento. Successivamente, scegli ciascun elemento, che dovrebbe essere allineato allo stesso modo.", "es": "Debe seleccionar un elemento de referencia para alinear. Luego, elige cada elemento, que debe estar alineado igual.", "pl": "Musisz wybrać element odniesienia do wyrównania. Następnie wybierz każdy element, który powinien być tak samo wyrównany.", "uk": "Потрібно вибрати опорний елемент для вирівнювання. Після цього виберіть кожен елемент, який повинен бути вирівняний однаково.", "zh-cn": "您需要选择一个参考元素进行对齐。然后，选择每个元素，它们应该对齐相同。"},
