    "ex_config_icon_ref": {                           "en": "Enter a keyword to search other icons",            "de": "Geben Sie ein Schlüsselwort ein, um nach anderen Symbolen zu suchen", "ru": "Введите ключевое слово для поиска других значков", "pt": "Digite uma palavra-chave para pesquisar outros ícones", "nl": "Voer een trefwoord in om naar andere pictogrammen te zoeken", "fr": "Entrez un mot-clé pour rechercher d'autres icônes", "it": "Inserisci una parola chiave per cercare altre icone", "es": "Ingrese una palabra clave para buscar otros íconos", "pl": "Wprowadź słowo kluczowe, aby wyszukać inne ikony", "uk": "Введіть ключове слово для пошуку інших значків",   "zh-cn": "输入关键字搜索其他图标"},
    "ex_config_icon_tipp": {                          "en": "<u>Tipp:</u>Square Icons need same width and height! Other ones can have other formats.", "de": "<u>Tipp:</u>Quadratische Symbole benötigen die gleiche Breite und Höhe! Andere können andere Formate haben.", "ru": "<u>Совет:</u>Квадратные значки должны иметь одинаковую ширину и высоту! Другие могут иметь другие форматы.", "pt": "<u>Dica:</u>Ícones quadrados precisam da mesma largura e altura! Outros podem ter outros formatos.", "nl": "<u>Tipp:</u>Vierkante pictogrammen hebben dezelfde breedte en hoogte nodig! Andere kunnen andere formaten hebben.", "fr": "<u>Conseil :</u>Les icônes carrées doivent avoir la même largeur et la même hauteur ! D'autres peuvent avoir d'autres formats.", "it": "<u>Suggerimento:</u>le icone quadrate devono avere la stessa larghezza e altezza! Altri possono avere altri formati.", "es": "<u>Consejo:</u>¡Los iconos cuadrados necesitan el mismo ancho y alto! Otros pueden tener otros formatos.", "pl": "<u>Wskazówka:</u>Ikony kwadratowe muszą mieć tę samą szerokość i wysokość! Inne mogą mieć inne formaty.", "uk": "<u>Порада.</u>Квадратні значки мають однакову ширину та висоту! Інші можуть мати інші формати.", "zh-cn": "<u>提示：</u>方形图标需要相同的宽度和高度！其他的可以有其他格式。"},
