    "ex_reconnect": {                                 "en": "Click the button above to reconnect the line",     "de": "Klicken Sie auf die Schaltfläche oben, um die Leitung erneut zu verbinden", "ru": "Нажмите кнопку выше, чтобы повторно подключить линию", "pt": "Clique no botão acima para reconectar a linha",    "nl": "Klik op de knop hierboven om de lijn opnieuw aan te sluiten", "fr": "Cliquez sur le bouton ci-dessus pour reconnecter la ligne", "it": "Fare clic sul pulsante in alto per ricollegare la linea", "es": "Haga clic en el botón de arriba para volver a conectar la línea", "pl": "Kliknij powyższy przycisk, aby ponownie podłączyć linię", "uk": "Натисніть кнопку вище, щоб повторно підключити лінію", "zh-cn": "单击上面的按钮重新连接线路"},
