    "ex_config_datasource": {                         "en": "Actions for the data source can be configured in the 'Advanced' tab", "de": "Aktionen für die Datenquelle können im Reiter „Erweitert“ konfiguriert werden", "ru": "Действия для источника данных можно настроить на вкладке «Дополнительно».", "pt": "As ações para a fonte de dados podem ser configuradas na guia 'Avançado'", "nl": "Acties voor de gegevensbron kunnen worden geconfigureerd op het tabblad 'Geavanceerd'", "fr": "Les actions pour la source de données peuvent être configurées dans l'onglet \"Avancé\".", "it": "Le azioni per l'origine dati possono essere configurate nella scheda \"Avanzate\".", "es": "Las acciones para la fuente de datos se pueden configurar en la pestaña 'Avanzado'", "pl": "Akcje dla źródła danych można skonfigurować w zakładce „Zaawansowane”.", "uk": "Дії для джерела даних можна налаштувати на вкладці «Додатково».", "zh-cn": "可以在“高级”选项卡中配置数据源的操作"},
    "help_preserveAspectRatio": {                     "en": "<p>The preserveAspectRatio attribute indicates how an element with a viewBox providing a given aspect ratio must fit into a viewport with a different aspect ratio.</p> <p>Please refer to <a href='https://www.kreyenborg.koeln/go/96nit' target='_blank'>MDN Web Docs</a> to read more about</p>", "de": "<p>Das Attribut „preserveAspectRatio“ gibt an, wie ein Element mit einer ViewBox, die ein bestimmtes Seitenverhältnis bereitstellt, in ein Ansichtsfenster mit einem anderen Seitenverhältnis passen muss.</p> <p>Bitte beachten Sie <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>MDN-Webdokumente</a>, um mehr darüber zu erfahren</p>", "ru": "<p>Атрибут saveAspectRatio указывает, как элемент с viewBox, обеспечивающим заданное соотношение сторон, должен вписываться в область просмотра с другим соотношением сторон.</p> <p>Обратитесь к <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>Веб-документы MDN</a>, о которых можно узнать подробнее</p>", "pt": "<p>O atributo preserveAspectRatio indica como um elemento com uma viewBox que fornece uma determinada proporção deve caber em uma janela de visualização com uma proporção diferente.</p> <p>Consulte <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>MDN Web Docs</a> para ler mais sobre</p>", "nl": "<p>Het kenmerk behoudenAspectRatio geeft aan hoe een element met een viewBox die een bepaalde beeldverhouding biedt, moet passen in een viewport met een andere beeldverhouding.</p> <p>Raadpleeg <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>MDN Web Docs</a> om meer over te lezen</p>", "fr": "<p>L'attribut préservationAspectRatio indique comment un élément avec une viewBox fournissant un rapport hauteur/largeur donné doit s'insérer dans une fenêtre avec un rapport hauteur/largeur différent.</p> <p>Veuillez vous référer à <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>MDN Web Docs</a> pour en savoir plus</p>", "it": "<p>L'attributo preserveAspectRatio indica come un elemento con un viewBox che fornisce una determinata proporzione deve adattarsi a un viewport con proporzioni diverse.</p> <p>Fai riferimento a <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>Documenti web MDN</a> per saperne di più</p>", "es": "<p>El atributo preserveAspectRatio indica cómo un elemento con un viewBox que proporciona una relación de aspecto determinada debe encajar en una ventana gráfica con una relación de aspecto diferente.</p> <p>Consulte <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>MDN Web Docs</a> para leer más sobre</p>", "pl": "<p>Atrybut keepAspectRatio wskazuje, jak element z polem widoku zapewniającym dany współczynnik proporcji musi zmieścić się w rzutni o innym współczynniku proporcji.</p> <p>Proszę zapoznać się z <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>Dokumenty internetowe MDN</a>, o których można przeczytać więcej</p>", "uk": "<p>Атрибут SaveAspectRatio вказує, як елемент із viewBox, що надає задане співвідношення сторін, має поміститися у вікно перегляду з іншим співвідношенням сторін.</p> <p>Будь ласка, зверніться до <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>веб-документи MDN</a>, щоб дізнатися більше</p>", "zh-cn": "<p>preserveAspectRatio 属性指示具有提供给定宽高比的 viewBox 的元素必须如何适应具有不同宽高比的视口。</p> <p>请参阅 <a href='https://www. kreyenborg.koeln/go/96nit' target='_blank'>MDN Web 文档</a>了解更多信息</p>"},
